prefix = 'hello ';
function handleNode(context) {
    const org_unit = JSON.parse(context.getParam('org_unit'));
  const sp = JSON.parse(context.getParam('no_sp'));
  const assignee = JSON.parse(context.getParam('no_assignee'));
  const epic_with_sp = JSON.parse(context.getParam('epic_with_sp'));
    const sub_task_with_sp = JSON.parse(context.getParam('sub_task_with_sp'));
    const no_initiatives = JSON.parse(context.getParam('no_initiatives'));

  var message = '';
  var jira_url = "https://thrasio.atlassian.net/browse/";

  var makeTable = function(response) {
    message = message + '<table border=1 cellpadding=5 style="border-collapse: collapse; ">';
    message = message + "<tr><th>Issue</th><th>Summary</th><th>Assignee</th></tr>";
    response.records.forEach(
      record => {
        message = message + "<tr><td><a href='"+ jira_url + record.key +"'>"+ `${record.key}`+"</a></td><td>" +`${record.summary}` + "</td><td>" + `${record.assignee}`+"</td></tr>";
    });
 	 message = message + "</table>";
    message += "<p>Total Issues: "+ response._metadata.total_count +"</p>"
  };

  if (sp.records.length > 0) {
    message = message + `<br/><b>Missing Story Points</b>`;
    makeTable(sp);
  }

  if (assignee.records.length > 0) {
    message = message + `<br/><b>Missing Assignee</b>`;
	makeTable(assignee);
  }

  if (epic_with_sp.records.length > 0) {
    message = message + `<br/><b>Epics with Story Point</b>`;
    makeTable(epic_with_sp);
  }

  if (sub_task_with_sp.records.length > 0) {
    message = message + `<br/><b>Sub Tasks with Story Point</b>`;
    makeTable(sub_task_with_sp);
  }

  if (no_initiatives.records.length > 0) {
    message = message + `<br/><b>No Initiatives</b>`;
    makeTable(no_initiatives);
  }

  message = message + "<p>Click <a href='https://app.propelo.ai/#/admin/dashboards/10?OU="+ org_unit.id +"&ou_category_id=c4b242be-89b2-44bd-92ad-72a90da050b6,a9cd0a91-af79-4de4-987f-e0b170cdddef&workspace_id=6'>here</a> to view the dashboard for more details.</p>";

  return { 
    state : 'success',
    output : { 
      'message' : message  
    } 
  };
}

